import React, { useState } from "react";
import { View, Text, TextInput, TouchableOpacity, Modal, FlatList } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { FontAwesome } from "@expo/vector-icons"; // Icons
import { Feather } from "@expo/vector-icons"; // Search Icon
import { StyleSheet } from "react-native";

const Navbar = ({ setSelectedCategory, setSearchQuery }) => {
  const navigation = useNavigation();
  const [eventsOpen, setEventsOpen] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState("");

  const eventCategories = ["Technical", "Sports", "Cultural", "Techno-Cultural"];

  const handleCategoryClick = (category) => {
    setSelectedCategory(category);
    setEventsOpen(false);
  };

  const handleSearch = (text) => {
    setSearchTerm(text);
    setSearchQuery(text);
  };

  return (
    <View style={styles.navbar}>
      {/* Logo */}
      <TouchableOpacity onPress={() => navigation.navigate("Home")}>
        <Text style={styles.logo}>TICKORA</Text>
      </TouchableOpacity>

      {/* Search Bar */}
      <View style={styles.searchContainer}>
        <TextInput
          style={styles.searchBar}
          placeholder="Search events..."
          value={searchTerm}
          onChangeText={handleSearch}
        />
        <TouchableOpacity>
          <Feather name="search" size={20} color="#333" style={styles.searchIcon} />
        </TouchableOpacity>
      </View>

      {/* Events Dropdown */}
      <TouchableOpacity onPress={() => setEventsOpen(true)}>
        <Text style={styles.navItem}>Events ▼</Text>
      </TouchableOpacity>

      <Modal visible={eventsOpen} transparent animationType="fade">
        <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <FlatList
              data={eventCategories}
              keyExtractor={(item) => item}
              renderItem={({ item }) => (
                <TouchableOpacity onPress={() => handleCategoryClick(item)}>
                  <Text style={styles.eventItem}>{item}</Text>
                </TouchableOpacity>
              )}
            />
            <TouchableOpacity onPress={() => setEventsOpen(false)}>
              <Text style={styles.closeButton}>Close</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>

      {/* Navigation */}
      <TouchableOpacity onPress={() => navigation.navigate("Blogs")}>
        <Text style={styles.navItem}>Blogs</Text>
      </TouchableOpacity>

      <TouchableOpacity onPress={() => navigation.navigate("CreateEvent")} style={styles.addBtn}>
        <Text style={styles.addBtnText}>+ Add</Text>
      </TouchableOpacity>

      {/* Profile Dropdown */}
      <TouchableOpacity onPress={() => setMenuOpen(true)}>
        <View style={styles.profile}>
          <Text style={styles.profileText}>S</Text>
        </View>
      </TouchableOpacity>

      <Modal visible={menuOpen} transparent animationType="fade">
        <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <TouchableOpacity onPress={() => alert("Account Details")}>
              <Text style={styles.dropdownItem}>Account Details</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert("Settings")}>
              <Text style={styles.dropdownItem}>Settings</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert("Help")}>
              <Text style={styles.dropdownItem}>Help</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert("Logout")}>
              <Text style={styles.dropdownItem}>Logout</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => setMenuOpen(false)}>
              <Text style={styles.closeButton}>Close</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  navbar: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    padding: 15,
    backgroundColor: "#fff",
    elevation: 5,
  },
  logo: {
    fontSize: 22,
    fontWeight: "bold",
    color: "blue",
  },
  searchContainer: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "#f9f9f9",
    borderRadius: 20,
    paddingHorizontal: 10,
    width: "45%",
  },
  searchBar: {
    flex: 1,
    padding: 8,
  },
  searchIcon: {
    marginLeft: 5,
  },
  navItem: {
    fontSize: 18,
    fontWeight: "bold",
    color: "#333",
  },
  addBtn: {
    backgroundColor: "black",
    padding: 10,
    borderRadius: 5,
  },
  addBtnText: {
    color: "white",
    fontSize: 18,
  },
  profile: {
    backgroundColor: "blue",
    width: 40,
    height: 40,
    borderRadius: 50,
    alignItems: "center",
    justifyContent: "center",
  },
  profileText: {
    color: "white",
    fontSize: 18,
    fontWeight: "bold",
  },
  modalContainer: {
    flex: 1,
    backgroundColor: "rgba(0,0,0,0.5)",
    justifyContent: "center",
    alignItems: "center",
  },
  modalContent: {
    backgroundColor: "#fff",
    padding: 20,
    borderRadius: 8,
    width: "80%",
    alignItems: "center",
  },
  dropdownItem: {
    fontSize: 16,
    padding: 10,
  },
  closeButton: {
    marginTop: 10,
    fontSize: 16,
    color: "red",
    fontWeight: "bold",
  },
  eventItem: {
    fontSize: 16,
    padding: 10,
    borderBottomWidth: 1,
    borderBottomColor: "#ccc",
  },
});

export default Navbar;
